import React, { useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import logo from "./../../assets/images/logo.jfif";
// import {
//   CounterContextProvider,
//   counterContext,
// } from "../../Context/CounterContext";
import { userContext } from "./../../Context/UserContext";


function Navbar() {
  // let { counter } = useContext(counterContext);
  let { userToken, setUserToken } = useContext(userContext);
  let navigate = useNavigate();

  function LogOut() {
    localStorage.removeItem("userToken");
    setUserToken(null);
    navigate("/LogIn");
  }

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">
          <img src={logo} alt="" className="w-25" />
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          {userToken ? (<ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link to="Home" className="nav-link active">
                  Home 
                </Link>
              </li>
              <li className="nav-item">
                <Link to="Register" className="nav-link">
                  Register
                </Link>
              </li>
              <li className="nav-item">
                <Link to="Cart" className="nav-link">
                  Cart
                </Link>
              </li>
              <li class="nav-item">
          <a class="nav-link" href="#">Products</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Categories</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Brands</a>
        </li>
            </ul>):""}
          <ul className="d-flex list-unstyled mb-0">
            <li>
              <i className="mx-2 fa-brands fa-youtube"></i>
            </li>
            <li>
              <i className="mx-2 fa-brands fa-facebook"></i>
            </li>
            <li>
              <i className="mx-2 fa-brands fa-instagram"></i>
            </li>
            <li>
              <i className="mx-2 fa-brands fa-linkedin"></i>
            </li>

            {userToken ? (
              <>
              <span>
                <i className="mx-2 fa-solid fa-cart"></i>
              </span>
              <li
                className="text-decotation-none text-black mx-2 pe-auto"
                onClick={() => {
                  LogOut();
                }}
              >
                LogOut
              </li></>
            ) : (
              <>
                <li className="mx-2">
                  <div>
                    <Link to="Register">Register</Link>
                  </div>
                </li>

                <li className="mx-2">
                  <div>
                    <Link to="LogIn">LogIn</Link>
                  </div>
                </li>
              </>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
